import HttpService from './HttpService';

export const SignUpService = (credentials) => {
	const http = new HttpService();



	return http.postData(credentials, 'signup').then(data=>{
		console.log(data)
		console.log('data')
		return data;

	}).catch(error=> console.log(error));
}
